CREATE TABLE Empleado(
	curp CHAR(18) NOT NULL CHECK(LEN(curp)=18) UNIQUE,
	numDepto INT NOT NULL,
	nombre VARCHAR(50) CHECK (nombre <>''),
	paterno VARCHAR(50) CHECK (paterno <>''),
	materno VARCHAR(50) CHECK (materno <> ''),
	salario INT NOT NULL,
	genero CHAR(1) NOT NULL,
	nacimiento DATE NOT NULL,
	ciudad VARCHAR(50) CHECK (ciudad <>''),
	calle VARCHAR(50) CHECK (calle <>''), 
	cp INT CHECK(cp between 10000 and 99999)
);

CREATE TABLE Departamento(
	numDepto INT NOT NULL UNIQUE,
	nombreDepto VARCHAR(50) CHECK (nombreDepto <> ''),
	fecha DATE NOT NULL
);

CREATE TABLE Proyecto(
	numProy INT NOT NULL UNIQUE,
	numDepto INT NOT NULL,
	nombreProy VARCHAR(50) CHECK(nombreProy <> ''),
	fecha DATE NOT NULL
);

CREATE TABLE Colaborar(
	curp CHAR(18) NOT NULL CHECK(LEN(curp)=18),
	numProy INT NOT NULL,
	numHoras INT NOT NULL
);

ALTER TABLE Empleado ADD CONSTRAINT empleado_pkey PRIMARY KEY (curp);
ALTER TABLE Departamento ADD CONSTRAINT departamento_pkey PRIMARY KEY(numDepto);
ALTER TABLE Proyecto ADD CONSTRAINT proyecto_pkey PRIMARY KEY(numProy);

ALTER TABLE Empleado ADD CONSTRAINT empleado_fkey FOREIGN KEY (numDepto)
REFERENCES Departamento(numDepto) ON UPDATE CASCADE ON DELETE CASCADE;

ALTER TABLE Proyecto ADD CONSTRAINT proyecto_fkey FOREIGN KEY (numDepto)
REFERENCES Departamento(numDepto) ON UPDATE CASCADE ON DELETE CASCADE;

ALTER TABLE Colaborar ADD CONSTRAINT colaborar_fkey1 FOREIGN KEY (curp)
REFERENCES Empleado(curp) ON UPDATE CASCADE ON DELETE CASCADE;
ALTER TABLE Colaborar ADD CONSTRAINT colaborar_fkey2 FOREIGN KEY (numProy)
REFERENCES Proyecto(numProy) ON UPDATE NO ACTION ON DELETE NO ACTION;

